import React from 'react'
import './styled-profile_repos.sass'

const ProfileRepos = ({ repos }) => (
    <div className='profileRepos'>
        {repos.map(repo => <li key={repo.id}><a href={repo.html_url}>‚óè {repo.name}</a></li>)}
    </div>
)

export default ProfileRepos;
